description:
When the students of Angel Beach High decide to stage &quot;An Evening With Shakespeare,&quot; their efforts are threatened by Miss Balbricker, who views the works of Shakespeare as obscene. She enlists the help of Reverend Bubba Flavel, a religious fanatic who brings along his flock of followers to pressure the school into shutting down the production. When they succeed with the help of corrupt city officials seeking re-election, the gang don't get mad... they get even!
